import React from "react";
import "./Header.css";
import {Link} from "react-router-dom";

function Header() {
    return (
        <div class="header">
            <Link to ="">
                <h1>Gavin Yahna's Portfolio</h1>
            </Link>
            <div class="navbar">
                <Link to="games">
                    <h2>Games</h2>
                </Link>
            </div>
        </div>
    );
}

export default Header;
